import React from 'react'
import './navbar.css'
import logoImage from '../../images/logo.svg';
import { Link, useMatch, useResolvedPath } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <Link>
        <img src={logoImage} alt="logo" className='logo'/>
      </Link>
    </div>
  )
}

export default Navbar
